['#include <stdio.h>
#include<string.h>

int main(void) {
	int n,p[100],count,size,found=0;
	char s[100][200];
	scanf("%d",&n);
	for(int i=0;i<n;i++)
	{
	    scanf("%d ",&p[i]);
	}
	for(int i=0;i<n;i++)
	{
	    gets(s[i]);
	}
	for(int i=0;i<n;i++)
	{
	    count=0;
	    size=0;
	    size=strlen(s[i]);
	    for(int j=0;j<size;j++)
	    {
	        if(s[i][j]=='a'||s[i][j]=='e'||s[i][j]=='i'||s[i][j]=='o'||s[i][j]=='u' || s[i][j] == 'y')
	        count++;
	    }
	    if(count!=p[i])
	    {
	      found=1;
	      break;
	    }
	}
	if(found)
	printf("NO");
	else
	printf("YES");
	return 0;
}
